import React from 'react';
import { Link } from 'react-router-dom';
import emailjs from 'emailjs-com';

function LandingPage() {
  // EmailJS handler
  const handleContactSubmit = (e) => {
    e.preventDefault();
    const form = e.target;
    emailjs.sendForm(
      'service_oildj6m',
      'template_05hymca',
      form,
      'gwttnJTCmPFTWS0TG'
    ).then(
      (result) => {
        alert('Message sent successfully!');
        form.reset();
      },
      (error) => {
        alert('Failed to send message. Please try again later.');
        console.error(error);
      }
    );
  };

  return (
    <>
      <style>{`
        /* ... (copy all <style> content from code (1).html here) ... */
      `}</style>
      <header>
        <nav className="container">
          <Link to="/" className="logo">ThetaSummary</Link>
          <ul>
            <li><a href="#features">Features</a></li>
            <li><a href="#how-it-works">How It Works</a></li>
            <li><a href="#showcase">Showcase</a></li>
            <li><a href="#contact">Contact</a></li>
          </ul>
          <div className="auth-buttons">
            <Link to="/login" className="btn btn-secondary">Login</Link>
            <Link to="/create-account" className="btn btn-primary">Create Account</Link>
          </div>
        </nav>
      </header>
      <main>
        {/* Hero Section */}
        <section id="hero" className="hero-section">
          <div className="container">
            <h1>Smart Lecture Management, Simplified.</h1>
            <p className="subtitle">Automatically record, transcribe, summarize, and organize your lectures for enhanced student engagement and unparalleled accessibility.</p>
            <Link to="/create-account" className="btn btn-primary btn-large">Get Started Free</Link>
            <div className="hero-image-placeholder">
              <p>Illustrative Graphic/App Mockup</p>
            </div>
          </div>
        </section>
        {/* ... (rest of the HTML structure, converting <a> to <Link> where needed, and using className) ... */}
        {/* Contact Section */}
        <section id="contact" className="contact-section">
          <div className="container">
            <h2>Get in Touch</h2>
            <p>Have questions or want a demo? We'd love to hear from you.</p>
            <form className="contact-form" onSubmit={handleContactSubmit}>
              <div className="form-group">
                <label htmlFor="name">Name</label>
                <input type="text" id="name" name="name" required />
              </div>
              <div className="form-group">
                <label htmlFor="email">Email</label>
                <input type="email" id="email" name="email" required />
              </div>
              <div className="form-group">
                <label htmlFor="message">Message</label>
                <textarea id="message" name="message" rows={5} required />
              </div>
              <button type="submit" className="btn btn-primary">Send Message</button>
            </form>
          </div>
        </section>
      </main>
      <footer>
        <div className="container">
          <p>&copy; 2025 ThetaSummary. All rights reserved.</p>
          <ul className="footer-links">
            <li><a href="#">Privacy Policy</a></li>
            <li><a href="#">Terms of Service</a></li>
          </ul>
        </div>
      </footer>
    </>
  );
}

export default LandingPage;
